import React from 'react';
import { StyleSheet, Text, View, Image } from 'react-native';

export default function App() {

  let mainImg = {
    uri: 'https://fontmeme.com/temporary/81750352183580c7a5e9d1f42b28f9d0.png'
  };
  return (
    <View style={styles.container}>
      <Image source={mainImg} style={{width: 600, height: 450}}/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
